import React from 'react';

const DataAkun = () => {
  return (
    <div style={{ marginLeft: '260px', padding: '20px' }}>
      <h1>Data Akun</h1>
      <p>Halaman ini menampilkan informasi akun pengguna.</p>
    </div>
  );
};

export default DataAkun;
